//trackThis.js
//http://github.com/jonathanhaslett/trackThis.js
function trackThis(){$('a[href^="tel:"]').on("click",function(e){var t=$(this).attr("href");_gaq.push(["_trackEvent","Telephone","Dialed",t])});$('a[href^="mailto:"]').on("click",function(e){var t=$(this).attr("href");_gaq.push(["_trackEvent","Email","Clicked",t])});$('a[href^="#"]').on("click",function(e){var t=$(this).attr("href");_gaq.push(["_trackPageview",$(location).attr("pathname")+t])})}trackThis();